void DNN_up::thread_hdltv_gen() {
    const char* dump_tv = std::getenv("AP_WRITE_TV");
    if (!(dump_tv && string(dump_tv) == "on")) return;

    wait();

    mHdltvinHandle << "[ " << endl;
    mHdltvoutHandle << "[ " << endl;
    int ap_cycleNo = 0;
    while (1) {
        wait();
        const char* mComma = ap_cycleNo == 0 ? " " : ", " ;
        mHdltvinHandle << mComma << "{"  <<  " \"ap_rst_n\" :  \"" << ap_rst_n.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"LS_stream_TDATA\" :  \"" << LS_stream_TDATA.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"LS_stream_TVALID\" :  \"" << LS_stream_TVALID.read() << "\" ";
        mHdltvoutHandle << mComma << "{"  <<  " \"LS_stream_TREADY\" :  \"" << LS_stream_TREADY.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"LS_stream_TLAST\" :  \"" << LS_stream_TLAST.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"DNN_out_TDATA\" :  \"" << DNN_out_TDATA.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"DNN_out_TVALID\" :  \"" << DNN_out_TVALID.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"DNN_out_TREADY\" :  \"" << DNN_out_TREADY.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"DNN_out_TLAST\" :  \"" << DNN_out_TLAST.read() << "\" ";
        mHdltvinHandle << "}" << std::endl;
        mHdltvoutHandle << "}" << std::endl;
        ap_cycleNo++;
    }
}

